--
-- Table structure for table `cardwars`
--

CREATE TABLE `cardwars` (
  `GameID` int(10) UNSIGNED NOT NULL,
  `Player1` varchar(45) NOT NULL,
  `Player2` varchar(45) NOT NULL,
  `Winner` varchar(45) NOT NULL,
  `Player1_Life` int(10) UNSIGNED NOT NULL DEFAULT 1000,
  `Player2_Life` int(10) UNSIGNED NOT NULL DEFAULT 1000,
  `Offense` int(10) UNSIGNED NOT NULL DEFAULT 1,
  `Defense` int(10) UNSIGNED NOT NULL DEFAULT 2,
  `ElementField` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `P1_Ready` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `P2_Ready` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `ChainPlayer` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `ChainCount` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `Surrender` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `StartDate` datetime NOT NULL,
  `LastActivity` datetime NOT NULL,
  `GameEnds` datetime DEFAULT NULL,
  `PlayerTurn` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `Rounds` int(10) UNSIGNED NOT NULL DEFAULT 1,
  `AttackerCard` varchar(50) DEFAULT '',
  `DefenderCard` varchar(50) DEFAULT '',
  `AttackerCardInfo` varchar(60) DEFAULT '',
  `DefenderCardInfo` varchar(60) DEFAULT '',
  `wager` int(10) NOT NULL DEFAULT 0
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci ROW_FORMAT=COMPACT;

